        "description": {
          "description": "\u003cdiv class=\"doc\"\u003e\u003cp\u003e\u003cem\u003eFirst matcher, Second matcher and Nonrange matcher\u003c/em\u003e\n\u003c/p\u003e\u003cp\u003eWhen we match for patches, we have a PatchSet, of which we want a\n subset. This subset is formed by the patches in a given interval\n which match a given criterion. If we represent time going left to\n right, then we have (up to) three \u003ccode\u003e\u003ca\u003eMatcher\u003c/a\u003e\u003c/code\u003es:\n\u003c/p\u003e\u003cul\u003e\u003cli\u003e the \u003ccode\u003efirstMatcher\u003c/code\u003e is the left bound of the interval,\n\u003c/li\u003e\u003cli\u003e the \u003ccode\u003esecondMatcher\u003c/code\u003e is the right bound, and\n\u003c/li\u003e\u003cli\u003e the \u003ccode\u003e\u003ca\u003enonrangeMatcher\u003c/a\u003e\u003c/code\u003e is the criterion we use to select among\n   patches in the interval.\n\u003c/li\u003e\u003c/ul\u003e\u003c/div\u003e",
          "module": "Darcs.Match",
          "name": "Match",
          "package": "darcs-beta",
          "source": "src/Darcs-Match.html",
          "type": "module"
        },
        "index": {
          "description": "First matcher Second matcher and Nonrange matcher When we match for patches we have PatchSet of which we want subset This subset is formed by the patches in given interval which match given criterion If we represent time going left to right then we have up to three Matcher the firstMatcher is the left bound of the interval the secondMatcher is the right bound and the nonrangeMatcher is the criterion we use to select among patches in the interval",
          "hierarchy": "Darcs Match",
          "module": "Darcs.Match",
          "name": "Match",
          "package": "darcs-beta",
          "partial": "Match",
          "type": "module"
        },
        "uri": "http://hackage.haskell.org/package/darcs-beta/docs/Darcs-Match.html#"
